import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./BlogHome.scss";

export default class BlogHome extends Component {
  constructor() {
    super();
    this.state = { readytouse: null };
  }

  render() {
    return (
      <div className="entire-blog-div">
        <div>
          <h1 className="entire-blog-title">The Lua Blog</h1>
          <h3 className="entire-blog-tagline">Learn And Be Inspired</h3>
        </div>
        <div className="blog-frame">
          <div className="blog-image-div">
            <img
              className="blog-image"
              src="https://images.unsplash.com/photo-1569012871812-f38ee64cd54c?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=800&q=60"
            ></img>
          </div>
          <div className="blog-post-title-div">
            <h1 className="blog-post-title">From Nightclub To Tinder</h1>
          </div>
          <div className="blog-post-snippet-div">
            <h1 className="blog-post-snippet">
              Jorge Hinojosa took the leap and went to a coding bootcamp in
              Dallas, after working in Economics for a couple years. Within a
              year, he got an offer to be a developer at Match!
            </h1>
          </div>
        </div>
      </div>
    );
  }
}
